query:
SELECT id, planSustitucionId, colaborador, cargo
FROM planes_sucesion
WHERE planSustitucionId IN (
  SELECT planSustitucionId FROM planes_sucesion GROUP BY planSustitucionId HAVING COUNT(*) > 1
)
ORDER BY planSustitucionId, id;

